
import { useState } from 'react';
import './App.css';

function App() {
  const levels = [
    { name: 'precision', code: '' },
  { name: 'got to go high', code: '' },
  { name: 'EZ RITE?', code: '' },
  { name: 'Glitch', code: '' },
  { name: 'OOMBA VALLEY', code: '' },
  { name: 'VALLEY FULLA APPL', code: '' },
  { name: 'OOMBA FACTORY', code: '' },
  { name: 'the last minute of oomba factory', code: '' },
  { name: 'FIND THE KEY', code: '' },
  { name: 'Up then down', code: '' },
  { name: 'THE TRAIN', code: '' },
   { name: 'Just crouch', code: '' },
  { name: 'a land of death ', code: '' },
  { name: '200 IQ', code: '' },
  { name: 'the dunes', code: '' },
  { name: 'the dunes II (new update)', code: '' },
  { name: 'The dunes III', code: '' },
  { name: 'The drop the unreachable goal', code: '' },
  { name: 'demonic 9/10', code: '' },
  { name: 'diddlnut', code: '' },
  { name: 'VALOR', code: '' },
    { name: 'precision part 2', code: '' },
    { name: 'APPELIus-appelnutt CAVE  PART 2', code: '' },
    { name: 'WONDERLAND', code: '' },
    { name: 'ELEMENT', code: '' },
    { name: 'Element II', code: '' },
    { name: 'The hive', code: '' },
    { name: 'korupdt', code: '' },
    { name: 'hello', code: '' },
    { name: 'The seven seas', code: '' }
  ];

  const [randomLevel, setRandomLevel] = useState(null);
  const [copied, setCopied] = useState(false);
  const [showHowTo, setShowHowTo] = useState(false);
  const [showMakeLevel, setShowMakeLevel] = useState(false);
  const [rolledIndexes, setRolledIndexes] = useState([]);

  const handleRandomLevel = () => {
    let availableIndexes = levels.map((_, idx) => idx).filter(idx => !rolledIndexes.includes(idx));
    // If all levels have been rolled, reset
    if (availableIndexes.length === 0) {
      setRolledIndexes([]);
      availableIndexes = levels.map((_, idx) => idx);
    }
    const idx = availableIndexes[Math.floor(Math.random() * availableIndexes.length)];
    setRandomLevel(levels[idx]);
    setRolledIndexes(prev => [...prev, idx]);
    setCopied(false);
  };

  const handleBackFromRandom = () => {
    setRandomLevel(null);
    setCopied(false);
  };

  const handleCopy = () => {
    navigator.clipboard.writeText(randomLevel.code);
    setCopied(true);
    setTimeout(() => setCopied(false), 3000);
  };

      return (
        <div className="App">
          <header className="App-header">
            {showHowTo ? (
              showMakeLevel ? (
                <div style={{ marginTop: '3rem', textAlign: 'center', color: '#fff' }}>
                  <h2 style={{ color: 'red', fontSize: '2rem' }}>Make Level Instructions</h2>
                  <iframe src="/make-level.pdf" style={{ width: '80vw', height: '70vh', border: '2px solid #000', borderRadius: '8px', background: '#fff' }} title="Make Level PDF" />
                  <br />
                  <button style={{ fontSize: '1rem', padding: '0.5rem 1rem', borderRadius: '6px', border: '2px solid black', cursor: 'pointer', marginTop: '1rem' }} onClick={() => setShowMakeLevel(false)}>Back</button>
                </div>
              ) : (
                <div style={{ marginTop: '3rem', textAlign: 'center', color: '#fff' }}>
                  <button style={{ fontSize: '1rem', padding: '0.5rem 1rem', borderRadius: '6px', border: '2px solid black', cursor: 'pointer', marginBottom: '1rem' }} onClick={() => alert('Big thanks to griffpatch and TurboWarp!')}>Creds</button>
                  <h2 style={{ color: 'red', fontSize: '2rem' }}>How to</h2>
                  <p style={{ fontSize: '1.1rem', color: '#fff', maxWidth: '400px', margin: '2rem auto' }}>
                    Welcome to Appel Codes!<br /><br />
                    1. Click <strong>Random Level</strong> to get a custom level code.<br />
                    2. Use the <strong>Copy</strong> button to copy the code.<br />
                    3. Click <strong>Run Appel</strong> to open the Appel game.<br />
                    4. Click play, then load, and then paste in the code.<br /><br />
                    Have fun!<br />
                    Our levels should not use any advanced moves.
                  </p>
                  <button style={{ fontSize: '1rem', padding: '0.5rem 1rem', borderRadius: '6px', border: '2px solid black', cursor: 'pointer', marginRight: '1rem' }} onClick={() => setShowHowTo(false)}>Back</button>
                  <button style={{ fontSize: '1rem', padding: '0.5rem 1rem', borderRadius: '6px', border: '2px solid black', cursor: 'pointer' }} onClick={() => setShowMakeLevel(true)}>Make Level</button>
                </div>
              )
            ) : (
              <>
                {!randomLevel && (
                  <>
                    <button
                      style={{ margin: '1.3rem 0', padding: '0.65rem 1.3rem', fontSize: '1.3rem', cursor: 'pointer', borderRadius: '7.8px', border: '2.6px solid black', background: '#fff' }}
                      onClick={() => window.open('/Appel v1.html', '_blank')}
                    >
                      Run Appel
                    </button>
                    <img src="appelimage.jpg" className="App-logo" alt="logo" style={{ width: '260px', height: 'auto' }} />
                    <p style={{ fontSize: '39px' }}>Appel custom level codes</p>
                  </>
                )}
                <p className="small" style={{ fontSize: '20.8px' }}>Click the button to get a random level:</p>
                <button onClick={handleRandomLevel} style={{ padding: '0.65rem 1.3rem', fontSize: '1.3rem', cursor: 'pointer', borderRadius: '7.8px', border: '2.6px solid black' }}>
                  Random Level
                </button>
                {!randomLevel && (
                  <div style={{
                    background: 'red',
                    color: 'white',
                    fontSize: '0.9rem',
                    borderRadius: '6px',
                    padding: '0.5rem 1rem',
                    margin: '60px auto 0 auto',
                    maxWidth: '220px',
                    fontWeight: 'bold',
                    boxShadow: '0 2px 8px rgba(0,0,0,0.08)',
                    cursor: 'pointer'
                  }} onClick={() => setShowHowTo(true)}>
                    How to
                  </div>
                )}
                {randomLevel && (
                  <>
                    <strong style={{ fontSize: '2rem', marginBottom: '1.2rem', letterSpacing: '2px' }}>Level Name:</strong>
                    <div style={{ fontSize: '1.3rem', wordBreak: 'break-all', marginBottom: '2rem', maxWidth: '90vw', textAlign: 'center', color: '#fff', letterSpacing: '1px', display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
                      {randomLevel.name}
                      {randomLevel.name === 'demonic 9/10' && (
                        <img src="/demon.png" alt="demon" style={{ height: '2.2rem', marginLeft: '0.7rem', verticalAlign: 'middle' }} />
                      )}
                    </div>
                    <button
                      style={{ marginTop: '1.3rem', padding: '0.65rem 1.3rem', fontSize: '1.3rem', cursor: 'pointer', borderRadius: '7.8px', border: '2.6px solid black', background: '#fff', marginBottom: '1.2rem' }}
                      onClick={handleCopy}
                    >
                      Copy Code
                    </button>
                    <button
                      style={{ marginTop: '1.3rem', padding: '0.65rem 1.3rem', fontSize: '1.3rem', cursor: 'pointer', borderRadius: '7.8px', border: '2.6px solid black', background: 'red', color: '#fff', display: 'block', marginLeft: 'auto', marginRight: 'auto', marginBottom: '1.2rem' }}
                      onClick={() => window.open('/Appel v1.html', '_blank')}
                    >
                      Start Appel
                    </button>
                    {randomLevel.name === 'precision part 2' && (
                      <div style={{ fontSize: '1.5rem', color: '#fff', marginTop: '0.5rem' }}>heh 69</div>
                    )}
                    {copied && (
                      <div style={{
                        marginTop: '1.3rem',
                        color: '#4caf50',
                        fontWeight: 'bold',
                        display: 'block',
                        fontSize: '1.3rem'
                      }}>
                        Code copied!
                      </div>
                    )}
                  </>
                )}
              </>
            )}
          </header>
        </div>
      );
}

export default App;
